INSERT INTO "Course" ("CourseID", "CourseName", "About", "Programm", "Requirements", "Result") VALUES(10, 'Философия естественных наук', 'Курс "Философия естественных наук" представляет собой изучение философских аспектов и проблем, связанных с естественными науками и их методами.
Цель курса - познакомить студентов с основными философскими концепциями и идеями, которые подкрепляют и объясняют развитие и функционирование естественных наук.', 'Введение в философию естественных наук:

Основные понятия и методы философии науки.
Роль философии в понимании естественных наук.
Эпистемология и методология:

Проблемы познания и истины.
Рациональность и эмпирическое знание.
Индукция и дедукция в естественных науках.
Философские проблемы физики:

Пространство, время и материя.
Микромир и макромир.
Философия квантовой механики и относительности.
Философские аспекты биологии:

Проблема жизни и ее происхождения.
Эволюция и ее философские интерпретации.
Философия генетики и нейробиологии.
Философия техники и технологии:

Техническое мышление и его воздействие на общество.
Человек и машина: этические и социальные аспекты.', 'Для успешного прохождения курса студентам требуется активное участие в лекциях и семинарах, выполнение домашних заданий и прохождение контрольных работ.
Рекомендуется иметь базовое понимание естественных наук и интерес к философии.', 'Понимание основных философских проблем, связанных с естественными науками.
Способность анализировать и оценивать философские аргументы и концепции в контексте естественных наук.
Развитие критического мышления и способности формулировать собственные философские взгляды.
Глубокое понимание взаимосвязи между философией и естественными науками.');
INSERT INTO "Course" ("CourseID", "CourseName", "About", "Programm", "Requirements", "Result") VALUES(2, 'Верстка и прототипирование', 'Курс посвященный верстке и прототпироания сайтов, созданию крупномасштабных приложений на современном технологическом стеке.', 'Будут изучены основы создания веб-приложений, а именно верстка, javascript, css, react и прочие технологии.', 'Необходимо иметь интелект чуть выше говорящего попугая. А также любить frontend всей душой и сердцем.', 'Вы станете сверхчеловеком - высшим разумом нашей галактической бесконечно вечной вселенной.');
INSERT INTO "Course" ("CourseID", "CourseName", "About", "Programm", "Requirements", "Result") VALUES(3, 'Мат анализ', 'Курс для людей, нелюбящих жизнь и всё, что с ней связано. Только хардкор, только адские страдания.', 'Будут ботаться матеша и статистика всякая, еще посчитаем вероятность победы на этом хакатоне, а также найдем количество перемещений с повторениями, написанных строчек кода.', 'Не нужно быть человеком, нужно быть его противоположностью.', 'Думаю они вам не нужны, если вы сюда попали, вам уже ничего не нужно.');
INSERT INTO "Course" ("CourseID", "CourseName", "About", "Programm", "Requirements", "Result") VALUES(1, 'Прикладная информатика', 'Курс "Прикладная информатика" представляет собой изучение основных принципов и практических навыков работы с информационными системами и программным обеспечением. Студенты узнают, как применять компьютерные технологии для решения задач в различных областях, таких как бизнес, наука, здравоохранение и другие.', 'Введение в информатику:

Основы компьютерных наук и история развития информационных технологий.
Роли и функции программного обеспечения.
Основы программирования:

Знакомство с основными понятиями программирования.
Разработка алгоритмов и структур данных.
Основные концепции языков программирования.
Базы данных:

Обзор различных видов баз данных.
Основы проектирования и управления базами данных.
Язык структурированных запросов SQL.
Веб-технологии:

Основы разработки веб-приложений.
Создание динамических веб-страниц с использованием HTML, CSS и JavaScript.
Введение в серверные технологии, такие как PHP или Python.
Анализ данных:

Основы обработки и анализа данных.
Исследование данных с использованием статистических методов и инструментов.
Машинное обучение и анализ больших данных.
Проектная работа:

Студенты участвуют в разработке и реализации проекта, связанного с прикладной информатикой.
Применение полученных знаний и навыков в реальных сценариях.', 'Базовые знания в области информационных технологий и компьютерной грамотности.
Желание учиться и осваивать новые навыки.
Доступ к компьютеру с установленным программным обеспечением для разработки (IDE, СУБД и др.).
Хорошее понимание английского языка, так как большая часть документации и ресурсов доступна на английском.', 'Понимание основных концепций и принципов информатики и программирования.
Умение разрабатывать программы на выбранном языке программирования.
Навыки работы с базами данных и языком SQL.
Знание основных технологий разработки веб-приложений.
Умение анализировать данные и применять статистические методы.
Практический опыт работы над проектом в области прикладной информатики.');
INSERT INTO "Course" ("CourseID", "CourseName", "About", "Programm", "Requirements", "Result") VALUES(9, 'Вероведение', 'Курс "Вероведение" предназначен для изучения основных религиозных и философских систем, а также для расширения понимания и осознания религиозной истории и культурного наследия различных народов.', 'Введение в вероведение: основные понятия и методы исследования вероучений.
История религиозных учений: изучение развития религиозных традиций от древности до настоящего времени.
Крупные религии мира: изучение основных характеристик и принципов вероисповеданий, таких как христианство, ислам, буддизм, индуизм, даосизм и других.
Философия религии: обзор основных философских концепций и подходов к религии.
Религиозные тексты и священные писания: анализ и интерпретация значимых источников религиозной мудрости и вероучения.
Религия и культура: изучение взаимосвязи между религией и культурой, а также влияния религиозных верований на общественные нормы и ценности.', 'Отсутствие предвзятого отношения к различным религиям и верованиям.
Базовые знания в области философии и истории.
Готовность к академическому анализу и обсуждению религиозных тем.
Умение работать с информацией и проводить исследования.', 'Понимание основных религиозных учений и исторических контекстов, в которых они возникли.
Способность анализировать и интерпретировать религиозные тексты и священные писания.
Умение проводить исследования в области вероведения и представлять полученные данные в письменной и устной форме.
Развитие критического и аналитического мышления при изучении религиозных феноменов.
Осознание взаимосвязи между религией, культурой и обществом.');
